import { Chart, Tooltip, Axis, Legend, Pie, Coord, Line, Bar, Point} from 'viser-react';
import * as React from 'react';
import { Row, Col, Card, Button, Icon, Progress, Form , Modal, Table} from "antd";
import axios from "axios";
import ReactApexChart from 'react-apexcharts'
import 'bootstrap/dist/css/bootstrap.min.css';
import $ from 'jquery';
import Popper from 'popper.js';
import 'bootstrap/dist/js/bootstrap.bundle.min';
import { CSVLink } from "react-csv";

import '@fortawesome/fontawesome-free/css/all.min.css';
import 'bootstrap-css-only/css/bootstrap.min.css';
import './assets/css/mdb.css';


  import {
  MDBSelect,
  MDBSelectInput,
  MDBSelectOptions,
  MDBSelectOption,
} from "mdbreact";

class SelectPage extends Component {
  state = {
    diameters: [
      { id: 1, value: "val1" },
      { id: 2, value: "val2" }
    ]
  }

  render() {
    return (
      <div>
        <MDBSelect multiple>
          <MDBSelectInput selected="Choose diameters" />
          <MDBSelectOptions>
            <MDBSelectOption disabled>Choose lengths</MDBSelectOption>
            {this.state.diameters.map((item) => (
              <MDBSelectOption value={item.id}>{item.value}</MDBSelectOption>
            ))}
          </MDBSelectOptions>
        </MDBSelect>
      </div>
    );
  }
}

export default SelectPage;
